  - name: TEXT4000
    number: '6'
    value: 'First, in response to the missing 48 hour notices:  After looking over
      the contributions, I realize that these were received on or after 11/3/08.  The
      campaign worked with a fundraiser, who would have received 6 of these checks
      and then sent them to me.  The other 4 checks came from out of town committees
      and were received by this office on or after 11/4/08.  When it came time for
      the post-general report, I used the check date as the date of the contribution,
      rather than the date I received the contribution in-hand.  In general, I felt
      it was more accurate to use the date the check was written, rather than the
      post mark when reporting, considering that checks came from different locations,
      not always mailed.  However, I did not consider that when it came to 48 hour
      notices, it would appear that there were some not included.  These contributions
      were not left out intentionally, they were not received in the window requiring
      48 hour notice.  Finally, I corrected a disbursement to the candidate.  The
      campaign has no debt and no obligations.  The candidate made a loan to the committee
      and received partial repayment after debts were paid.  The campaign account
      was closed.  Once again, thank you for your assistance.   Sarah M. Raybon, Treasurer.'
